pragma solidity ^0.8.7;

import "./IotaHeroFactory.sol";
import "./IotaHeroGameTokens.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Receiver.sol";

contract IotaHeroStore is Ownable, ERC1155Receiver {
    IotaHeroGameTokens public tokens;

    enum StoreStatus {
        OPEN,
        CLOSED,
        WHITELISTONLY
    }
    uint256 nextStoreId = 0;

    struct Store {
        uint256 id;
        string name;
        StoreStatus status;
        ProductLine[] productLines;
        uint256 nextProductLineId;
    }
    Store[] public stores;

    struct ProductLine {
        uint256 id;
        uint256 tokenId;
        uint256 amount;
        uint256 price;
        uint32 limit;
    }

    mapping(uint256 => bool) storeIdExists;
    mapping(uint256 => mapping(uint256 => bool)) storeIdToProductLineExists;
    mapping(uint256 => address[]) storeIdToWhiteList;
    mapping(uint256 => mapping(address => bool)) storeIdToUserInWhitelist;
    mapping(uint256 => mapping(uint256 => uint256)) storeIdToTokenIdAmountHeld;

    event ItemBought(
        address indexed buyer,
        uint256 indexed storeId,
        uint256 tokenId,
        uint256 amount
    );

    function getTokensBalance(uint256 storeId, uint256 tokenId)
        public
        view
        returns (uint256)
    {
        return storeIdToTokenIdAmountHeld[storeId][tokenId];
    }

    function setTokenAddress(address _tokenAddress) public onlyOwner {
        tokens = IotaHeroGameTokens(_tokenAddress);
    }

    function getTokenAddress() public view returns (address) {
        return address(tokens);
    }

    function getProducts(uint256 storeId)
        public
        view
        returns (ProductLine[] memory)
    {
        require(storeIdExists[storeId], "store does not exist");
        Store storage store = stores[storeId];
        return store.productLines;
    }

    function buyProduct(
        uint256 storeId,
        uint256 productLineId,
        uint256 amount
    ) public payable {
        require(storeIdExists[storeId], "store does not exist");
        require(
            storeIdToProductLineExists[storeId][productLineId],
            "Productline does not exist in this store"
        );
        Store storage store = stores[storeId];
        if (store.status == StoreStatus.WHITELISTONLY) {
            require(
                storeIdToUserInWhitelist[storeId][msg.sender],
                "User is not whitelisted"
            );
        } else {
            require(store.status == StoreStatus.OPEN, "store is not open");
        }
        ProductLine storage pl = store.productLines[productLineId];
        require(pl.limit >= amount, "you cant buy that many due to item limit");
        require(pl.amount >= amount, "Product line doesn't have enough tokens");
        require(msg.value >= pl.price * amount, "didnt receive enough value");
        pl.amount = pl.amount - amount;
        uint256 prevBalance = storeIdToTokenIdAmountHeld[storeId][
            productLineId
        ];
        storeIdToTokenIdAmountHeld[storeId][productLineId] =
            prevBalance -
            amount;
        tokens.safeTransferFrom(
            address(this),
            msg.sender,
            pl.tokenId,
            amount,
            ""
        );
        emit ItemBought(msg.sender, storeId, pl.tokenId, amount);
    }

    function addProductLineToStore(
        uint256 storeId,
        uint256 tokenId,
        uint256 amount,
        uint256 price,
        uint32 limit
    ) public onlyOwner {
        require(storeIdExists[storeId], "store does not exist");
        require(
            storeIdToTokenIdAmountHeld[storeId][tokenId] >= amount,
            "Store doesn't have sufficient tokens"
        );
        // TODO Need to check if the token is already part of one productline so we dont put too many for sale, maybe change storeIdToTokenIdAmountHeld -> storeIdToTokenIdAmountAvailToCreateSalesItems
        Store storage store = stores[storeId];
        ProductLine memory pl = ProductLine(
            store.nextProductLineId,
            tokenId,
            amount,
            price,
            limit
        );
        store.productLines.push(pl);
        storeIdToProductLineExists[storeId][store.nextProductLineId] = true;
        store.nextProductLineId++;
    }

    function createStore(string memory name, StoreStatus status)
        public
        onlyOwner
    {
        stores.push();
        uint256 newIndex = stores.length - 1;
        stores[newIndex].id = nextStoreId;
        stores[newIndex].name = name;
        stores[newIndex].status = status;
        storeIdExists[newIndex] = true;
        nextStoreId++;
    }

    function changeStoreStatus(uint256 _storeId, StoreStatus status)
        public
        onlyOwner
    {
        Store storage store = stores[_storeId];
        store.status = status;
    }

    function _addToWhiteList(uint256 _storeId, address addressToAdd)
        internal
        onlyOwner
    {
        if (!storeIdToUserInWhitelist[_storeId][addressToAdd]) {
            storeIdToWhiteList[_storeId].push(addressToAdd);
            storeIdToUserInWhitelist[_storeId][addressToAdd] = true;
        }
    }

    function addToWhiteList(
        uint256 _storeId,
        address[] memory addressesToWhitelist
    ) public onlyOwner {
        require(storeIdExists[_storeId], "store does not exist");
        for (uint256 i = 0; i < addressesToWhitelist.length; i++) {
            _addToWhiteList(_storeId, addressesToWhitelist[i]);
        }
    }

    function formatBytes(uint256 num) public pure returns (bytes memory) {
        return abi.encodePacked(num);
    }

    function onERC1155Received(
        address,
        address,
        uint256 tokenId,
        uint256 amount,
        bytes memory data
    ) public virtual override returns (bytes4) {
        require(msg.sender == address(tokens), "Wrong token contract");
        uint256 storeId = toUint256(data);
        require(storeIdExists[storeId], "store does not exist");
        _addBalanceToStore(storeId, tokenId, amount);
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(
        address,
        address,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) public virtual override returns (bytes4) {
        uint256 storeId = toUint256(data);
        require(msg.sender == address(tokens), "Wrong token contract");
        require(storeIdExists[storeId], "store does not exist");
        for (uint256 i = 0; i < ids.length; i++) {
            _addBalanceToStore(storeId, ids[i], amounts[i]);
        }
        return this.onERC1155BatchReceived.selector;
    }

    function _addBalanceToStore(
        uint256 _storeId,
        uint256 tokenId,
        uint256 amount
    ) internal {
        uint256 currentAmount = storeIdToTokenIdAmountHeld[_storeId][tokenId];
        storeIdToTokenIdAmountHeld[_storeId][tokenId] = currentAmount + amount;
    }

    function toUint256(bytes memory _bytes)
        internal
        pure
        returns (uint256 value)
    {
        assembly {
            value := mload(add(_bytes, 0x20))
        }
    }
}
